export const addShow = (showName, venue, date) => {
    let showObject= {
        showName,
        venue,
        date
    };
    return {
        type: 'ADD_SHOW',
        payload: showObject
    }
}

export const getShows = () => {
    return {
        type: 'GET_SHOWS'
    }
}

export const deleteShow = () => {
    return {
        type: 'DELETE_SHOW'
    }
}
